import React from "react";
import axios from "axios";
import { useState, useEffect } from "react";
function Plan() {
  const [plan, setPlan] = useState({});
  console.log("hiiiiiii");
  useEffect(() => {
    async function getAllPlan() {
      try {
        const plan = await axios.get("http://127.0.0.1:8000/list/");
        console.log("Hiiiiiiii11111111");
        console.log(plan.data);
      } catch (error) {
        console.log(error);
      }
    }
    getAllPlan();
  }, []);
  <h1>Connect with Django</h1>;
  return plan.map((plan, i) => {
    return <h2 key={i}>{plan.Plan}</h2>;
  });
}

export default Plan;
